import React, { useState } from 'react';
import { Lock, User as UserIcon, Eye, EyeOff, ChevronDown } from 'lucide-react';
import './LoginScreen.css';

export function LoginScreen({ onLogin }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [selectedRole, setSelectedRole] = useState('doctor');
  const [showPassword, setShowPassword] = useState(false);
  const [rememberMe, setRememberMe] = useState(false);

  // Prevent page from being covered by TopBar/Sidebar by using absolute/fixed positioning only for those, not here
  // Remove any 100vh/viewport height that causes zooming or overflow

  const handleSubmit = (e) => {
    e.preventDefault();
    onLogin({
      id: `user-${Date.now()}`,
      name: username || 'Demo User',
      role: selectedRole
    });
  };

  const roleLabels = {
    nurse: 'Nurse',
    doctor: 'Doctor',
    admin: 'Admin',
    pharmacy: 'Pharmacy'
  };

  return (
    <div className="login-container">
      {/* Main Container */}
      <div className="login-card">
        {/* Left Side - Illustration */}
        <div className="login-illustration">
          <img 
            src="/home-page-image.png" 
            alt="Medical Team Illustration"
            loading="eager"
          />
        </div>
        {/* Right Side - Login Form */}
        <div className="login-form-container">
          {/* Hospital Header removed as requested */}
          {/* Welcome Header */}
          <div className="welcome-header">
            <h2 className="welcome-title">
              Welcome Back {roleLabels[selectedRole]}!
            </h2>
            <p className="welcome-subtitle">Lets get you Logged in</p>
          </div>

          {/* Login Form */}
          <form onSubmit={handleSubmit} className="login-form">
            
            {/* Username Input */}
            <div>
              <div className="input-container">
                <input
                  type="text"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  placeholder="max.alan@hkgeneral.com"
                  className="form-input"
                />
              </div>
            </div>

            {/* Password Input */}
            <div>
              <div className="input-container">
                <input
                  type={showPassword ? 'text' : 'password'}
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  placeholder="••••••••••••••••"
                  className="form-input password-input"
                />
                <button
                  type="button"
                  onClick={() => setShowPassword(!showPassword)}
                  className="password-toggle"
                  style={{ left: 'unset', right: '1.25rem' }}
                >
                  {showPassword ? 'Hide' : 'Show'}
                </button>
              </div>
            </div>

            {/* Role Dropdown */}
            <div>
              <div className="input-container">
                <select
                  value={selectedRole}
                  onChange={(e) => setSelectedRole(e.target.value)}
                  className="form-input"
                  style={{ appearance: 'none', cursor: 'pointer' }}
                >
                  {Object.entries(roleLabels).map(([role, label]) => (
                    <option key={role} value={role}>{label}</option>
                  ))}
                </select>
              </div>
            </div>

            {/* Remember Me & Need Help */}
            <div className="remember-section">
              <label className="remember-checkbox-label">
                <input
                  type="checkbox"
                  checked={rememberMe}
                  onChange={(e) => setRememberMe(e.target.checked)}
                  className="remember-checkbox"
                />
                <span className="remember-text">Remember Me !</span>
              </label>
              <button type="button" className="need-help-button">
                Need Help?
              </button>
            </div>

            {/* Login Button */}
            <button
              type="submit"
              className="login-button"
            >
              Login
            </button>

            {/* Alternative Login Options */}
            <div className="alternative-login">
              <p className="alternative-login-text">Alternative Login Options</p>
              <div className="alternative-buttons">
                <button
                  type="button"
                  className="alternative-button"
                >
                  <span className="alternative-button-text">Login with Google</span>
                </button>
                <button
                  type="button"
                  className="alternative-button"
                >
                  <span className="alternative-button-text">Login with Twitter</span>
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
